import React, { useEffect } from "react";
import Navbar from "../../components/Navbar";
import { Formik, Field, Form } from "formik";
import { Button } from "@/components/ui/button";
import { Input } from "@/components/ui/input";
import { Card, CardContent, CardHeader, CardTitle } from "@/components/ui/card";

function Login() {
  useEffect(() => {
    document.title = "Admin | Login";
  }, []);

  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-gray-100 dark:bg-gray-900 font-inter px-4">
      <Navbar />
      <Card className="w-full max-w-md shadow-lg rounded-2xl bg-white dark:bg-gray-800">
        <CardHeader>
          <CardTitle className="text-center text-2xl font-bold text-gray-800 dark:text-white">
            Admin Girişi
          </CardTitle>
        </CardHeader>
        <CardContent>
          <Formik
            initialValues={{ name: "", email: "" }}
            onSubmit={async (values) => {
              await new Promise((resolve) => setTimeout(resolve, 500));
              alert(JSON.stringify(values, null, 2));
            }}
          >
            <Form className="flex flex-col space-y-4">
              <div>
                <label className="block text-sm font-medium text-gray-700 dark:text-gray-300">
                  İsim
                </label>
                <Field
                  as={Input}
                  name="name"
                  type="text"
                  placeholder="Adınızı girin"
                  className="mt-1 w-full"
                />
              </div>
              <div>
                <label className="block text-sm font-medium text-gray-700 dark:text-gray-300">
                  E-Posta
                </label>
                <Field
                  as={Input}
                  name="email"
                  type="email"
                  placeholder="E-posta adresinizi girin"
                  className="mt-1 w-full"
                />
              </div>
              <Button type="submit" className="w-full">
                Giriş Yap
              </Button>
            </Form>
          </Formik>
        </CardContent>
      </Card>
    </div>
  );
}

export default Login;
